import React, { useState, useEffect } from "react";
import UserService from "../services/user.service";
const BoardUser = () => {
  const [content, setContent] = useState("");
  useEffect(() => {
    UserService.getUserBoard().then(
      (response) => {
        setContent(response.data);
      },
      (error) => {
        const _content =
          (error.response &&
            error.response.data &&
            error.response.data.message) ||
          error.message ||
          error.toString();
        setContent(_content);
      }
    );
  }, []);
  return (
    <div className="container max-w-none mx-auto board-user">
      <div className="container mx-auto">
        <div className="grid grid-cols-12 gap-2 board-grid">
          <div className="col-span-3 box shadow">1</div>
          <div className="col-span-3 box shadow">2</div>
          <div className="col-span-3 box shadow">3</div>
          <div className="col-span-3 box shadow">4</div>
        </div>
        <div className="grid grid-cols-12 gap-2 board-grid">
          <div className="col-span-6 box shadow">1</div>
          <div className="col-span-6 box shadow">2</div>
        </div>
      </div>
    </div>
  );
};
export default BoardUser;
